import React from "react";
import {Link} from "react-router-dom";

const Home = () => {
    return (
        <>
            <h3>Admin</h3>
            <ul style={{liststyleType: 'none'}}>
                <li>
                    <Link to={'/customers'}>Customers</Link>
                </li>
            </ul>
        </>
    );
};

export default Home;
